import "../styles/Navbar.css";

export default function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">
        <span className="logo-box">MLS</span>
        Publications
      </div>

      <ul className="nav-links">
        <li className="active">Home</li>
        <li>About</li>
        <li>Publications</li>
        <li>Submission Guidelines</li>
        <li>Journal Policies</li>
        <li>Submit Manuscript</li>
        <li>Contact Us</li>
      </ul>
    </nav>
  );
}
